v2((data, context) => {
  const token = 'Tokens: ' + (data.AllowTokenTemplates ? '✅' : '➖');
  const razor = 'Razor: ' + (data.AllowRazorTemplates ? '✅' : '➖');
  const ajax = 'Ajax: ' + (data.SupportsAjaxReload ? '✅' : '➖');
  return data.default + ' (' + [token, razor, ajax].join('; ') + ')';
});

v2((data, context) => {
  const sxc = '2sxc: ' + (data.RequiredVersion || '?');
  const dnn = 'Dnn: ' + (data.RequiredDnnVersion || '?');
  const oqt = 'Oqt: ' + (data.RequiredOqtaneVersion || '❔');
  return data.default + ' (' + [sxc, dnn, oqt].join('; ') + ')';
});

v2((data, context) => {
  return `${data.default} (2sxc v${data.sxcVersionMin}; Dnn v${data.dnnVersionMin}; Oqtane v${data.oqtVersionMin})`;
});

v2((data, context) => {
  // Use regex to keep only digits (0-9) and dots (.)
  return data.value.replace(/[^0-9.]/g, '');
});

v2((data, context) => {
  function isValidVersion(version) {
    // Regex pattern: 
    // ^\d{2,}$ - starts with at least 2 digits
    // \.       - literal dot
    // \d{2,}   - at least 2 digits  
    // \.       - literal dot
    // \d{2,}$  - ends with at least 2 digits
    const versionPattern = /^\d{2,}\.\d{2,}\.\d{2,}$/;
    return typeof version === 'string' && versionPattern.test(version);
  }

  if (isValidVersion(data.version))
    return;
  return {
    value: {
      severity: "error",
      message: "Please provide a version in the format 00.00.00"
    }
  };
});

v2((data, context) => {
  // console.log("isnew", context.target.entity.isNew);
  // console.log('edition', data.value, `isEmpty: ${data.value.length}`);

  // 1. Exit if editing something existing
  if (!context.target.entity.isNew)
    return;

  // Otherwise try to set default to best possible value
  // 2. wait for options to exist
  if (data.options.length == 0)
    return;

  // 3. Find default if given, and select that, then stop the formula
  const best = data.options.find(o => o?.data?.IsDefault ?? false);
  // console.log('options', data.options, best);
  return { 
    value: best ? [best.value] : data.value,
    stop: true
  };
});
